import {BrowserRouter,Route,Routes,Link} from "react-router-dom";  

import Login from "./login";


const Home=()=> {

  return (
      <BrowserRouter>
        <Routes>


          <Route key={path} path={path} element={component} {...routes}/>
          <Route exact={true} path="/backend" element={<Backend/>}/>
          <Route exact={true} path="/admin" element={<Admin/>}/>
          <Route exact={true} path="/" element={<Home_page/>}/>
        </Routes>
      </BrowserRouter>
  )
}

export default Home;
